  fullName: "com.google.cloud.speech.v1p1beta1.PhraseSet.Phrase.Builder"
  type: "Class"
  package: "com.google.cloud.speech.v1p1beta1"
  summary: "\n A phrases containing words and phrase \"hints\" so that\n the speech recognition is more likely to recognize them. This can be used\n to improve the accuracy for specific words and phrases, for example, if\n specific commands are typically spoken by the user. This can also be used\n to add additional words to the vocabulary of the recognizer. See\n <a href=\"https://cloud.google.com/speech-to-text/quotas#content\">usage limits</a>.\n List items can also include pre-built or custom classes containing groups\n of words that represent common concepts that occur in natural language. For\n example, rather than providing a phrase hint for every month of the\n year (e.g. \"i was born in january\", \"i was born in febuary\", ...), use the\n pre-built <code>$MONTH</code> class improves the likelihood of correctly transcribing\n audio that includes months (e.g. \"i was born in $month\").\n To refer to pre-built classes, use the class' symbol prepended with <code>$</code>\n e.g. <code>$MONTH</code>. To refer to custom classes that were defined inline in the\n request, set the class's <code>custom_class_id</code> to a string unique to all class\n resources and inline classes. Then use the class' id wrapped in $<code>{...}</code>\n e.g. \"${my-months}\". To refer to custom classes resources, use the class'\n id wrapped in <code>${}</code> (e.g. <code>${my-months}</code>).\n \n\n Protobuf type <code>google.cloud.speech.v1p1beta1.PhraseSet.Phrase</code>"
