  type: "Method"
  package: "com.google.cloud.speech.v1p1beta1"
  summary: "\n Hint Boost. Overrides the boost set at the phrase set level.\n Positive value will increase the probability that a specific phrase will\n be recognized over other similar sounding phrases. The higher the boost,\n the higher the chance of false positive recognition as well. Negative\n boost values would correspond to anti-biasing. Anti-biasing is not\n enabled, so negative boost will simply be ignored. Though <code>boost</code> can\n accept a wide range of positive values, most use cases are best served\n with values between 0 and 20. We recommend using a binary search approach\n to finding the optimal value for your use case. Speech recognition\n will skip PhraseSets with a boost value of 0.\n \n\n <code>float boost = 2;</code>"
  syntax:
    content: "public PhraseSet.Phrase.Builder clearBoost()"
    return:
      type: "com.google.cloud.speech.v1p1beta1.PhraseSet.Phrase.Builder"
      description: "This builder for chaining."
